import React, { useState, useEffect, useCallback } from 'react';
import { fetchPhotoById } from './api';
import { useParams, Link } from 'react-router-dom';
import { Card, CardMedia, CardContent, Typography, Button, Alert, Container, Box, Chip, Avatar, Divider, Skeleton } from '@mui/material';
import FavoriteIcon from '@mui/icons-material/Favorite';
import RefreshIcon from '@mui/icons-material/Refresh';

function PhotoDetail() {
  const { id } = useParams();
  const [photo, setPhoto] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [refreshKey, setRefreshKey] = useState(0);

  const loadPhoto = useCallback(async () => {
    try {
      setError(null);
      setLoading(true);
      const response = await fetchPhotoById(id);
      setPhoto(response.data);
    } catch (error) {
      setError("Fotoğraf detayı yüklenirken bir hata oluştu.");
      console.error("Fotoğraf detayları yüklenirken hata oluştu:", error);
    } finally {
      setLoading(false);
    }
  }, [id]);

  useEffect(() => {
    loadPhoto();
  }, [loadPhoto, refreshKey]);

  if (error) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
        <Box sx={{ display: "flex", gap: 2 }}>
          <Button
            variant="outlined"
            startIcon={<RefreshIcon />}
            onClick={() => setRefreshKey((prev) => prev + 1)}
          >
            Yeniden Dene
          </Button>
          <Button component={Link} to="/" variant="contained" color="primary">
            Ana Sayfaya Dön
          </Button>
        </Box>
      </Container>
    );
  }

  if (loading) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Skeleton variant="rectangular" height={400} sx={{ borderRadius: 4, mb: 2 }} />
        <Box sx={{ pt: 0.5 }}>
          <Skeleton width="60%" />
          <Skeleton width="35%" />
          <Skeleton width="60%" />
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Button component={Link} to="/" startIcon={<RefreshIcon />} sx={{ mb: 3 }}>
        Geri Dön
      </Button>
      <Divider sx={{ mb: 3 }} />
      <Card>
        <CardMedia
          component="img"
          height="500"
          image={photo?.thumbnailUrl || photo?.url}
          alt={photo?.title}
          sx={{ objectFit: "contain" }}
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            {photo?.title}
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
            Albüm ID: {photo?.albumId}
          </Typography>
          {photo?.user && (
            <Chip
              avatar={<Avatar>{photo.user.name?.[0] || "U"}</Avatar>}
              label={photo.user.name || "Bilinmeyen Kullanıcı"}
              sx={{ mb: 2 }}
            />
          )}
          <Box sx={{ display: "flex", gap: 1 }}>
            <Button
              variant="outlined"
              startIcon={<FavoriteIcon />}
              onClick={() => {
                // TODO: Favori ekle
                alert("Favorilere eklendi!");
              }}
            >
              Favorilere Ekle
            </Button>
          </Box>
        </CardContent>
      </Card>
    </Container>
  );
}

export default PhotoDetail;
